AUDIO_CODEC_MAP = {
    "AAC (default)": ["-c:a", "aac", "-b:a", "320k"],  # Alta calidad de audio
    "MP3": ["-c:a", "libmp3lame", "-b:a", "320k"],  # MP3 de alta calidad
    "AC3": ["-c:a", "ac3", "-b:a", "320k"],  # Mejor calidad para audio surround
    "Opus": ["-c:a", "libopus", "-b:a", "192k"],  # Códec de alta calidad para streaming
    "Vorbis": ["-c:a", "libvorbis", "-b:a", "320k"],  # Códec de alta calidad para web
    "Copy (no change)": ["-c:a", "copy"]  # Copiar audio sin cambios
}

SUPPORTED_FORMATS = ["*.mp4", "*.mkv", "*.avi", "*.mov", "*.flv", "*.wmv", "*.webm", "*.mpeg", "*.mpg", "*.ts", "*.gif", "*.m2ts"]

# Función para verificar que la calidad de video seleccionada es válida
def validate_video_quality(quality):
    if quality not in VIDEO_QUALITY_MAP:
        raise ValueError(f"Calidad de video no válida: {quality}")
    return VIDEO_QUALITY_MAP[quality]

# Función para verificar que el códec de audio seleccionado es válido
def validate_audio_codec(codec):
    if codec not in AUDIO_CODEC_MAP:
        raise ValueError(f"Códec de audio no válido: {codec}")
    return AUDIO_CODEC_MAP[codec]

# Función para verificar si el formato de archivo es compatible
def validate_format(file):
    for fmt in SUPPORTED_FORMATS:
        if file.endswith(fmt.replace("*.", "")):
            return True
    raise ValueError(f"Formato de archivo no compatible: {file}")

# Función para generar el comando FFmpeg
def build_ffmpeg_command(input_file, output_file, video_quality, audio_codec):
    try:
        # Validar parámetros
        video_params = validate_video_quality(video_quality)
        audio_params = validate_audio_codec(audio_codec)
        validate_format(input_file)

        # Construir el comando FFmpeg
        command = ["ffmpeg", "-i", input_file] + video_params + audio_params + [output_file]
        print(f"Comando generado: {command}")
        
        # Ejecutar el comando
        subprocess.run(command, check=True)
        print(f"Archivo {output_file} generado exitosamente.")

    except ValueError as e:
        print(f"Error: {e}")
    except subprocess.CalledProcessError as e:
        print(f"Error al ejecutar FFmpeg: {e}")
    
# Icono base64
icon_base64 = """"""

class MediaProcessorThread(QThread):
    log_update = pyqtSignal(str)
    finished = pyqtSignal(bool, str)

    def __init__(self, command):
        super().__init__()
        self.command = command
        self.cancelled = False

    def run(self):
        try:
            process = subprocess.Popen(
                self.command, stdout=subprocess.PIPE, stderr=subprocess.STDOUT, text=True
            )
            while True:
                output = process.stdout.readline()
                if not output and process.poll() is not None:
                    break
                if output:
                    self.log_update.emit(output.strip())
                if self.cancelled:
                    process.kill()
                    self.finished.emit(False, "Process was cancelled")
                    return
            self.finished.emit(True, "Media processed successfully!")
        except Exception as e:
            self.finished.emit(False, f"Error: {e}")

